import React, { Component } from 'react'
import {Navbar, Nav, Container} from 'react-bootstrap'
import light from './light.png'
import logout from './logout.png'
import menu from './menu.png'
import styles from './header.module.css';


const AuthenticatedMenu = ({isAuthenticated, toggleMenu  }) => {
  const handleButtonClick = () => {
    console.log('Кнопка "open-btn" нажата');
    toggleMenu(); // Вызов функции toggleMenu
  };
  return (
    <>
    <Navbar expand="lg" className={`${styles.menu_gradient} navbar-transparent p-0`}>
          <Container>
            <Nav className='w-100 d-flex justify-content-between align-items-center'>
              
              <Nav.Item>
                <Nav.Link href="#">
                <button className="open-btn" onClick={handleButtonClick}>
                  <img src={menu} width="25" height="25" alt="Menu Icon" loading="lazy" />
            </button>
                </Nav.Link>
              </Nav.Item>

              <Nav.Item>
                <Nav.Link href="#">
                  <p style={{ fontWeight: 'bold', fontSize: '20px' }}></p>
                </Nav.Link>
              </Nav.Item>

              <Nav.Item>
                <Nav.Link href="#">
                  <p style={{ fontWeight: 'bold', fontSize: '20px' }}>еДиплом</p>
                </Nav.Link>
              </Nav.Item>

              <Nav.Item>
                <Nav.Link href="#">
                  <img src={light} width="25" height="25" alt="Icon" loading="lazy" />
                </Nav.Link>
              </Nav.Item>

              <Nav.Item>
                <Nav.Link href="/">
                  <img src={logout} width="25" height="25" alt="Icon" loading="lazy" />
                </Nav.Link>
              </Nav.Item>

            </Nav>
          </Container>
        </Navbar>
            </>
  );
};

// Компонент для неавторизованных пользователей
const UnauthenticatedMenu = ({isAuthenticated }) => {
  return (
    <>
    <Navbar expand="lg" variant="light" className={`${styles.menu_gradient} navbar-transparent p-0`}>
          <Container>
            <Nav className='w-100 d-flex justify-content-between align-items-center'>
              <Nav.Item>
                <Nav.Link href="#">
                  <p>Нужна помощь?</p>
                </Nav.Link>
              </Nav.Item>
              <Nav.Item>
                <Nav.Link href="#">
                  <p style={{ fontWeight: 'bold', fontSize: '20px' }}>еДиплом</p>
                </Nav.Link>
              </Nav.Item>
              <Nav.Item>
                <Nav.Link href="#">
                  <img src={light} width="25" height="25" alt="Icon" loading="lazy" />
                </Nav.Link>
              </Nav.Item>
            </Nav>
          </Container>
        </Navbar>
            </>
  );
};

// Основной компонент, который решает, какое меню отображать
const Header = ({ isAuthenticated, toggleMenu  }) => {
  return (
    <div>
      {isAuthenticated ? <AuthenticatedMenu toggleMenu={toggleMenu} /> : <UnauthenticatedMenu />}
    </div>
  );
};

export default Header;
